import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, Dimensions, ImageBackground } from 'react-native';


export default class WhereToFind extends React.Component {
    render() {
        return (
            
                     <Text style={styles.styletext}>WHERE TO FIND US</Text>
              
        );
    }
}

const styles = StyleSheet.create({
    container: {
        width: Dimensions.get('window').width - 30,
        marginTop: 20,
        height: 100,
        flex: 1,
        borderRadius: 15,
        backgroundColor: '#fff',
        justifyContent: 'center',
        alignItems: 'center'

    },
    styletext:{
        color: '#000',
        fontSize: 25,
        fontWeight: 'bold'
    }
});
